  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:34.922139\",\n\t\"name\": \"management-guidelines-of-the-central-mississippi-and-pacific-flyways-for-the-mid-continent\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This plan sets forth guidelines for the
  cooperative management of the Mid-continent Population of sandhill cranes (hereafter
  MCP). The range of the MCP is extensive (Figure 1). During the breeding season,
  these cranes are widely scattered throughout central, northern, and southeast Canada
  (Appendix A and B); Alaska; northeastern Siberia; and northwestern Minnesota. Fall
  migration routes include areas where large numbers of MCP cranes stage in Alberta,
  Saskatchewan, Manitoba, North Dakota, and in recent years, Kansas (Appendix B).
  Other fall staging areas are located in northwestern Minnesota, Montana, Wyoming,
  South Dakota, Colorado, and Oklahoma. During autumn and winter, MCP cranes are in
  Oklahoma, Texas, New Mexico, Arizona, and also northern and central Mexico, primarily
  in the Interior Highlands in the states of Chihuahua and Durango. At some time during
  late February to early April each year, the majority of individuals in the MCP are
  among the spectacular numbers of migratory birds which stage in the central Platte
  Valley of Nebraska.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
